import Header from './header'
import style from './index.module.css'


function Contato() {

    function sendForm(e) {
        e.preventDefault()
        // Fazer requisiçao no back-end e enviar o formulario
    }

    return (
    <div>
        <style jsx global>{`
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            body {
                background-color: rgb(225,225,225);
            }

            form {
                width: 40%;
                max-width: 500px;
                position: absolute;
                left: 50%;
                top: 50%;
                transform: translate(-50%, -50%);
                padding: 20px;
                background: white;
            }

            input[type=text], input[type=email] {
                width: 100%;
                height: 35px;
                display: block;
                margin-bottom: 15px;
                font-size: 15px;
                border: 1px solid #ccc;
                padding-left: 8px;
            }

            textarea {
                width: 100%;
                height: 120px;
                display: block;
                margin-bottom: 15px;
                font-size: 15px;
                border: 1px solid #ccc;
                padding-left: 8px; 
            }
        `}</style>
        <Header></Header>
        <div>
        <form onSubmit={(e)=>sendForm(e)}>
            <input placeholder="Seu Nome..." type="text" />
            <input placeholder="Seu E-mail..." type="email" />
            <textarea placeholder="Sua menssagem..."></textarea>
            <input value="Enviar!" type="submit" />
        </form>
        </div>
    </div>)
}
  
export default Contato
